if !exists(.parsed_data) {
    structured, err = parse_json(.message)
    if err == null {
        .parsed_data = structured
    } else {
        .parsed_data = .message
    }
}

condition:
if is_boolean(.parsed_data.severity) || is_float(.parsed_data.severity) {
    data, err = to_string(.parsed_data.severity);
    if err != null {
        false;
    } else {
        includes(["aaa",42], data);
    };
} else {
    includes(["aaa",42], .parsed_data.severity);
}

if exists(.parsed_data.namespace) && is_string(.parsed_data.namespace) {
    matched = false
    matched0, err = match(.parsed_data.namespace, r'^dev-.*$')
    if err != null {
        true
    }
    matched = matched || matched0
    matched1, err = match(.parsed_data.namespace, r'^prod-.*$')
    if err != null {
        true
    }
    matched = matched || matched1
    !matched
} else {
    true
}
